import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import Button from "../components/Button";
import InputField from "../components/InputField";
import logo from "../assets/LOGO.png";
import "../styles/SignIn.css";

const SignIn = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: "",
    password: "",
    role: ""
  });
  
  const [errors, setErrors] = useState({});
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
    
    // Clear error when user types
    if (errors[name]) {
      setErrors({
        ...errors,
        [name]: ""
      });
    }
  };

  const validateForm = () => {
    const newErrors = {};
    
    // Email validation
    if (!formData.email.trim()) {
      newErrors.email = "Email is required";
    } else if (!/^\S+@\S+\.\S+$/.test(formData.email)) {
      newErrors.email = "Email is invalid";
    }
    
    // Password validation
    if (!formData.password) {
      newErrors.password = "Password is required";
    }
    
    // Role validation
    if (!formData.role) {
      newErrors.role = "Please select a role";
    }
    
    return newErrors;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Validate form
    const formErrors = validateForm();
    if (Object.keys(formErrors).length > 0) {
      setErrors(formErrors);
      return;
    }
    
    setIsSubmitting(true);
    
    try {
      // Here you would typically make an API call to authenticate the user
      // For now, we'll just simulate a successful login
      
      setTimeout(() => {
        // Redirect to the appropriate dashboard based on role
        if (formData.role === "student") {
          navigate("/StudentDashboard");
        } else {
          navigate("/TeacherDashboard");
        }
        setIsSubmitting(false);
      }, 1000);
      
    } catch (error) {
      setIsSubmitting(false);
      console.error("Login failed:", error);
      // Handle login error
    }
  };

  const navigateToSignUp = () => {
    navigate("/SignUp");
  };

  return (
    <div className="signin-container">
      <div className="signin-form-container">
        <div className="logo-container">
          <img src={logo} alt="TALIM Logo" className="signin-logo" />
        </div>
        
        <h1 className="signin-title">Sign In to Your Account</h1>
        
        <form className="signin-form" onSubmit={handleSubmit}>
          <InputField
            label="Email Address"
            type="email"
            placeholder="johndoe@example.com"
            value={formData.email}
            onChange={(e) => handleChange({ target: { name: 'email', value: e.target.value } })}
            error={errors.email}
          />
          
          <InputField
            label="Password"
            type="password"
            placeholder="********"
            value={formData.password}
            onChange={(e) => handleChange({ target: { name: 'password', value: e.target.value } })}
            error={errors.password}
          />
          
          <InputField
            label="Role"
            type="select"
            value={formData.role}
            onChange={(e) => handleChange({ target: { name: 'role', value: e.target.value } })}
            error={errors.role}
            options={[
              { value: "student", label: "Student" },
              { value: "teacher", label: "Teacher" }
            ]}
          />
          
          <div className="forgot-password">
            <span onClick={() => console.log("Forgot password clicked")}>
              Forgot Password?
            </span>
          </div>
          
          <Button type="submit" variant="dark" onClick={null}>
            {isSubmitting ? "Signing In..." : "Sign In"}
          </Button>
        </form>
        
        <div className="signup-redirect">
          <p>
            Don't have an account?{" "}
            <span className="signup-link" onClick={navigateToSignUp}>
              Sign Up
            </span>
          </p>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
